import './App.css';
import React from "react";
import CreateGame from "./components/CreateGame";
import CreateKey from "./components/CreateKey";
import CreateReview from "./components/CreateReview";

function App() {
    return (
        <div className="App">
            <CreateGame/>
            <CreateReview/>
            <CreateKey/>
        </div>
    );
}

export default App;
